var FormInputMask = function () {
    
    var handleInputMasks = function () {

        if( /Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini|Mobile|mobile|CriOS/i.test(navigator.userAgent) ) {
		 	// some code..
		}else{
			
	        $(".currency").inputmask('decimal', {
	            radixPoint:".", 
	            groupSeparator: ",", 
	            digits: 12,
	            autoGroup: true,
	            greedy: false,
	            prefix: '',
	            rightAlign: false
	        }).attr('autocomplete','off');

		}

        $(".numeric").inputmask('decimal',{
            /*mask: "9.",
            groupSeparator: ",", 
            digits: 2,
            repeat: 100,
            greedy: false*/
            radixPoint: ".", 
	        autoGroup: true, 
	        groupSeparator: ".", 
	        groupSize: 3, 
	        greedy: false,
	        digits: 2,
	        rightAlign: false
        }).attr('autocomplete','off');
    }

    return {
        //main function to initiate the module
        init: function () {
            handleInputMasks();
        }
    };

}();



var TotalAmount = function () {
    
    var handleTotalAmount = function () {
        var totalAmountVal = $('.total-amount');
        var total_amount = 0;
        $('.amount ').each(function(){
            var str = $(this).val();
            var amount = str.replace_all(',','');
            amount_value =  parseFloat(amount);
            if(!isNaN(amount_value)){
                total_amount+=amount_value;
            }

        });
        totalAmountVal.html(total_amount.toFixed(2).replace(/(\d)(?=(\d\d\d)+(?!\d))/g, "$1,"));
    }

    return {
        init: function () {
            handleTotalAmount();
        }
    };

}();

